    return (
        <nav>
        <NavLink to="/about" className='brand'>ckcg avion</NavLink>
            <ul>
                <li><NavLink to="/about" className='link-item'>accueil</NavLink></li>
                <li><NavLink to="/about" className='link-item'>association</NavLink></li>
                <li><NavLink to="/about" className='link-item'>services</NavLink></li>
                <li><NavLink to="/about" className='link-item'>gallerie</NavLink></li>
                <li><NavLink to="/about" className='link-item'>contact</NavLink></li>
            </ul>     
        <NavLink to="/about" className='connexion'>Connexion/Inscription</NavLink>
        </nav> 
    );
};

export default Nav;
